public class SnortParseException extends Exception {

	private static final long serialVersionUID = -6562570951231636750L;
	public SnortParseException() {
		// TODO Auto-generated constructor stub
	}

	public SnortParseException(String message) {
		super(message);
	}
	
	public SnortParseException(String message, Throwable cause) {
		super(message, cause);
	}	
	
	public SnortParseException(Throwable cause) {
		super(cause);
	}
		
}
